    font-family:"Arial",sans-serif;color:#202124;background:white'>. Los otros
    son África, América, Antártida, Asia y Oceanía. Europa se extiende desde el
    Ártico, en el norte, al mar Mediterráneo, en el sur, y desde el océano Atlántico,
    en el oeste, hasta las montañas de los Urales (en Rusia), en el este.</span></span><span
    style='font-size:14.0pt;line-height:106%'><o:p></o:p></span></p>
